package com.fashion.binge.fashiondesign.models;/** * Created by gokarna on 02/06/16. */public class ShippingModel {    private String shippingMethodId;    private String methodDiscriptions;    private String cost;    private String costUnformatted;    public String getCostUnformatted() {        return costUnformatted;    }    public void setCostUnformatted(String costUnformatted) {        this.costUnformatted = costUnformatted;    }    public String getShippingMethodId() {        return shippingMethodId;    }    public void setShippingMethodId(String shippingMethodId) {        this.shippingMethodId = shippingMethodId;    }    public String getMethodDiscriptions() {        return methodDiscriptions;    }    public void setMethodDiscriptions(String methodDiscriptions) {        this.methodDiscriptions = methodDiscriptions;    }    public String getCost() {        return cost;    }    public void setCost(String cost) {        this.cost = cost;    }}